func:
// Set message topic
msg.topic = "material"

// Pressure
msg.payload.material_pressure_ai0 = (msg.payload.material_io_ai0 < 0) ? 0.0 : (msg.payload.material_io_ai0 / 27468 * 25.0);
msg.payload.material_pressure_ai1 = (msg.payload.material_io_ai1 < 0) ? 0.0 : (msg.payload.material_io_ai1 / 27468 * 25.0);

// Temperature pumping chamber
msg.payload.material_temperature_ai2 = (msg.payload.material_io_ai1 < 0) ? 0.0 : (msg.payload.material_io_ai1 / 27468 * 100.0);

// Convert analog inputs to mA
msg.payload.material_io_ai0 = (msg.payload.material_io_ai0 < 0) ? 0.0 : (msg.payload.material_io_ai0 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai1 = (msg.payload.material_io_ai1 < 0) ? 0.0 : (msg.payload.material_io_ai1 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai2 = (msg.payload.material_io_ai2 < 0) ? 0.0 : (msg.payload.material_io_ai2 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai3 = (msg.payload.material_io_ai3 < 0) ? 0.0 : (msg.payload.material_io_ai3 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai4 = (msg.payload.material_io_ai4 < 0) ? 0.0 : (msg.payload.material_io_ai4 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai5 = (msg.payload.material_io_ai5 < 0) ? 0.0 : (msg.payload.material_io_ai5 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai6 = (msg.payload.material_io_ai6 < 0) ? 0.0 : (msg.payload.material_io_ai6 / 27468 * 16.0 + 4.0);
msg.payload.material_io_ai7 = (msg.payload.material_io_ai7 < 0) ? 0.0 : (msg.payload.material_io_ai7 / 27468 * 16.0 + 4.0);

// Coriolis conversions
msg.payload.material_coriolis_mass_flow = msg.payload.material_coriolis_mass_flow / 60.0
msg.payload.material_coriolis_volume_flow = msg.payload.material_coriolis_volume_flow / 60.0
msg.payload.material_coriolis_density = msg.payload.material_coriolis_density * 1000.0
msg.payload.material_coriolis_exciter_current_0 = msg.payload.material_coriolis_exciter_current_0 * 1000.0
msg.payload.material_coriolis_exciter_current_1 = msg.payload.material_coriolis_exciter_current_1 * 1000.0

// Bronkhorst conversion
msg.payload.material_bronkhorst_read_setpoint_slope = msg.payload.material_bronkhorst_read_setpoint_slope / 10.0

return msg
